import React from 'react';
import { Button, ButtonGroup, Card, Col, Container, Row } from 'react-bootstrap';
import { Rating } from './Rating';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Product } from './products';

interface AppProps {
  products: Product[]
}

function App(props: AppProps) {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>
            <ButtonGroup>
              <Button variant="outline-dark">Dry</Button>
              <Button variant="outline-secondary">Oily</Button>
            </ButtonGroup>
          </Col>
        </Row>
        <Row>
          {props.products.map(product => 
          <Col>
            <Card style={{ width: '18rem' }}>
              <Card.Img variant="top" src={product.productImageUrl} />
              <Card.Body>
                <Card.Title>{product.name}</Card.Title>
                <Card.Subtitle>{product.brand} 
                  <div style={{ float: 'right'}}>{product.price}</div>
                </Card.Subtitle>
                <Card.Subtitle><Rating score={product.rating} /></Card.Subtitle>
                <Card.Text>
                  {product.description.replaceAll('%2C', ',')}
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
          </Col>
          )}
        </Row>
      </Container>
    </div>
  );
}

export default App;
